export class Buffer {
    /**
     * @param {TimeRanges} buf
     * @returns {number}
     */
    static start(buf: TimeRanges): number;
    /**
     * @param {TimeRanges} buf
     * @returns {number}
     */
    static end(buf: TimeRanges): number;
    /**
     * @param {{buffered?: TimeRanges}} b
     * @returns {TimeRanges | void}
     */
    static get(b: {
        buffered?: TimeRanges;
    }): TimeRanges | void;
    /**
     * @param {TimeRanges} buf
     * @param {number} [maxHole]
     * @returns {[number,number][]}
     */
    static buffers(buf: TimeRanges, maxHole?: number): [number, number][];
    /**
     * @param {TimeRanges} buf
     * @param {number} [maxHole]
     * @returns {{buffers:[number,number][],length:number}}
     */
    static totalLength(buffers: any): {
        buffers: [number, number][];
        length: number;
    };
    /**
     *
     * @param {TimeRanges} buf
     * @param {number} [pos=0]
     * @param {number} [maxHole=0]
     * @returns {{start:number,end:number,buffers:[number,number][],remaining:number,index?:number,nextStart?:number,nextEnd?:number,prevStart?:number,prevEnd?:number}}
     */
    static info(buf: TimeRanges, pos?: number, maxHole?: number): {
        start: number;
        end: number;
        buffers: [number, number][];
        remaining: number;
        index?: number;
        nextStart?: number;
        nextEnd?: number;
        prevStart?: number;
        prevEnd?: number;
    };
}
